def xgcd(a,b):
    x0,y0,x1,y1 = 1,0,0,1
    while b!=0:
        q,a,b = a//b,b,a%b
        x0,x1 = x1,x0 - q * x1
        y0,y1 = y1,y0 -q * y1
    return a,x0,y0

def modinv(a,m):
    g,x,y = xgcd(a,m)
    return x%m

